import React, { useState } from 'react'
import { Context } from './components/Context'
import { AppRouter } from './router/AppRouter'

export const Openbank = () => {

    const [checkpoints, setcheckpoints] = useState({'acceptContract':false, 'passwordAccepted':false})
    const [activeStep, setActiveStep] = useState(0);

    return (
        <Context.Provider value ={{checkpoints, setcheckpoints, activeStep, setActiveStep}}>
            <AppRouter />
        </Context.Provider>
    )

}
